import React from 'react';
import { Grommet } from 'grommet';
import  Header from './Header/index.js';
const theme = {
	global: {
		colors: {
			brand: '#339C51'
		},
		font: {
			family: 'Poppins',
			size: '18px'
		}
	}
};

function App() {
	return (
		<Grommet theme={theme}>
			<Header />
		</Grommet>
	);
}

export default App;
